import React, { Component } from "react";
import "../App.css";

class Footer extends Component {
  render() {
    return (
      <footer>
        <p className="ending">&#169; 2020 Fresh Take by: Chris Yee, Tiffany Wong, Nicola Kalderash</p>
      </footer>
    );
  }
}

export default Footer;
